import React, { Component } from "react";
import GitConnectionForm from "./GitConnectionForm";

class Profile extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-6">
          <div>
            <GitConnectionForm />
          </div>
        </div>
        <div className="col-6">
          <h4>Profile Informations</h4>
        </div>
      </div>
    );
  }
}

export default Profile;
